//DivisorsInput
		
//NumberOutput
		int h=1;
		for(int i=1;i<=1; i++) {
			for (int j=1; j<=5;j++) {
			 if (j==1) {
				System.out.println(j+"2345"+h);
			 h++;
			 }
			 if (j==2) {
				 System.out.println(j+"345"+h);
				 h++;
			 }
			 if (j==3) {
				 System.out.println(j+"45"+h);
				 h++;
			 }
			 if (j==4) {
				 System.out.println(j+"5"+h);
				 h++;
			 }
			 if (j==5) {
				 System.out.println(j+""+h);
				 h++;
			 }
			}
		}
//PrimeFactorization(Hard)
